import { Component } from "react";

type Cliente = {
  id: string;
  nome: string;
  cpf: string;
  rg: string;
  dataEmissao: string;
  telefone: string;
  dataCadastro: string;
  dataNascimento: string;
  genero: string;
};

type ListaClientesProps = {
  clientes: Cliente[];
  onEdit: (cliente: Cliente) => void;
};

export default class ListaClientes extends Component<ListaClientesProps> {
  render() {
    const { clientes, onEdit } = this.props;

    return (
      <div>
        <h5 className="center-align">Lista de Clientes</h5>
        <ul>
          {clientes.length > 0 ? (
            clientes.map((cliente) => (
              <li key={cliente.id}>
                <p><strong>Nome:</strong> {cliente.nome}</p>
                <p><strong>CPF:</strong> {cliente.cpf}</p>
                <p><strong>RG:</strong> {cliente.rg}</p>
                <p><strong>Data de Emissão:</strong> {cliente.dataEmissao}</p>
                <p><strong>Telefone:</strong> {cliente.telefone}</p>
                <p><strong>Data de Cadastro:</strong> {cliente.dataCadastro}</p>
                <p><strong>Data de Nascimento:</strong> {cliente.dataNascimento}</p>
                <p><strong>Gênero:</strong> {cliente.genero}</p>
                <button onClick={() => onEdit(cliente)}>Editar</button>
              </li>
            ))
          ) : (
            <p>Nenhum cliente cadastrado.</p>
          )}
        </ul>
      </div>
    );
  }
}
